import React from 'react';

import Navbar from 'react-bootstrap/Navbar';
import City from '../assets/helpme.png';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Nav from 'react-bootstrap/Nav';

export const Home = () =>(
    <div>
        <div class = "ExtendedNavbarBackground">
                    <Navbar bg ="transparent">
                        <Nav.Link href="#home">helpme.io</Nav.Link>
                        <Nav.Link href="#procefures">Procedures</Nav.Link>
                        <Nav.Link href="#procefures">Hospitals</Nav.Link>
                        <Nav.Link href="#aboutus">About Us</Nav.Link>
                    </Navbar>
                    <div class ="ExtendedNavbarLower">
                        <Row>
                            <Col><h1 class = "ExtendedNavbarTitle">A smarter way to find affordable healthcare</h1></Col>
                            <Col><img class ="CityImage" src={City}/></Col>
                        </Row>
                    </div>
                </div>
    </div>
)
